import React, { Component } from 'react';
import StatsCard from './StatsCard';
import {Row, Col } from "react-bootstrap";
import AdminNavbar from "./AdminNavbar";

const mealUrl = "https://api.fitbit.com/1/user/28H22H/foods/log/date/2015-09-01.json"


export default class Home extends Component 
{
  constructor(props)
  {
    super(props)
    this.setState = {
      mealLog : {}
    }
  }

componentDidMount()
{

}

    render() {
        return (
          <div className="main-panel" id="main-panel">
          <AdminNavbar data={this.props.userDetails}/>
            <div className="content">
        <div className="container">
          <Row>
      <NavDropdown title="Select Food Filters" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
      <Nav.Link eventKey={2} href="#memes">
         <DatePicker selected={this.state.startDate} onChange={(date) => this.setState({ startDate: date })}name="startDate"
              dateFormat="MM/dd/yyyy"/>
      </Nav.Link>
      <Nav.Link eventKey={2} href="#memes"> <DatePicker selected={this.state.endDate} onChange={(date) => this.setState({ endDate: date })} name="endDate"
              dateFormat="MM/dd/yyyy"/>
      </Nav.Link>
          </Row>
          <Row>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="pe-7s-server text-warning" />}
                statsText="Capacity"
                statsValue="500"
                statsIcon={<i className="fa fa-refresh" />}
                statsIconText="Updated now"
              />
            </Col>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="pe-7s-wallet text-success" />}
                statsText="Revenue"
                statsValue="$1,345"
                statsIcon={<i className="fa fa-calendar-o" />}
                statsIconText="Last day"
              />
            </Col>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="pe-7s-graph1 text-danger" />}
                statsText="Errors"
                statsValue="23"
                statsIcon={<i className="fa fa-clock-o" />}
                statsIconText="In the last hour"
              />
            </Col>
            <Col lg={3} sm={6}>
              <StatsCard
                bigIcon={<i className="fa fa-twitter text-info" />}
                statsText="Followers"
                statsValue="+45"
                statsIcon={<i className="fa fa-refresh" />}
                statsIconText="Updated now"
              />
            </Col>
          </Row>
          </div>
      </div>
      </div>

        )
    }
}
